import React from "react";

class Marca extends React.Component{

    manejadorSubmit(e){
        e.preventDefault();
    }
    manejadorSubmit2 =e=>{
        e.preventDefafult();
    }

    render(){
        return(
            <React.Fragment>
                <div className="container">
                    <header className="heading"> Ingresar Marca</header><hr></hr>
                    <div className="row ">
                        <div className="col-sm-2">
                            <div className="row">
                                <form onSubmit={this.manejadorSubmit}>
                                    <input type="text" name="Imarca" id="imarca" placeholder="Ingrese la Marca" className="form-control "/>
                                </form>    
                            </div>
                        </div>
                    </div>
                        <div className="col-sm-12">
                                <div className="btn btn-warning">Agregar</div>
                        </div>
                    </div>
            </React.Fragment>
        );

    }
}

export default Marca
